          Learn React
        </a>
      </header> */}
      <NavigationBar />
      <Routes>
        <Route path="/" element={<BrandPage/>} />
        <Route path="/" element={<ServicesPage/>} />
      </Routes>
    </div>
  );
}

export default App;
